import React from 'react';
import {
  Button,
  FormControl,
  Grid,
  InputLabel,
  MenuItem,
  Paper,
  Select,
  TextField,
  Typography,
} from '@material-ui/core';

import CloudUploadIcon from '@material-ui/icons/CloudUpload';
import SaveIcon from '@material-ui/icons/Save';

import { useStyles } from './css/main';

export default function Register() {
  const classes = useStyles();

  /* doSubmit = async () => {
    const { data } = this.state;
  }; */

  
  const [firstName, setFirstName] = React.useState('');
  const [lastName, setLastName] = React.useState('');
  const [email, setEmail] = React.useState('');
  const [password, setPassword] = React.useState('');
  const [profilePicture, setProfilePicture] = React.useState('');

  /*
  const handleChange = (event) => {
    setAge(event.target.value);
  }; */

  return (
    <Grid
      container
      direction="row"
      justify="center"
      alignItems="center"
      className={classes.registerContainer}
    >
      <Grid item>
        <Paper elevation={24} className={classes.registerPaperClass}>
          <form
            // onSubmit={this.handleSubmit}
            method="POST"
            autoComplete="off"
            className={classes.form}
          >
            <Typography variant="h6" className={classes.root}>
              נא הירשם כדי להיות חלק ממסעדה!
            </Typography>

            <TextField
              id="outlined-basic"
              label="שם פרטי"
              variant="outlined"
              value={firstName}
              onChange={setFirstName}
            />

            <TextField
              id="outlined-basic"
              label="שם משפחה"
              variant="outlined"
              value={lastName}
              onChange={setLastName}
            />

            <TextField
              id="outlined-basic"
              label="אימייל"
              variant="outlined"

              // value={lastName}
              // onChange={setLastName}
            />
            <br />

            <TextField
              id="outlined-basic"
              label="סיסמה"
              variant="outlined"

              value={email}
              onChange={setEmail}
            />

            <br />
            {/* DROP DOWN SELECT/OPTION */}

            <FormControl variant="outlined" className={classes.formControl}>
              <InputLabel id="demo-simple-select-outlined-label">
                DORON
              </InputLabel>
              <Select
                labelId="demo-simple-select-outlined-label"
                id="demo-simple-select-outlined"
                // value={age}
                // onChange={handleChange}
                label="Age"
              >
                <MenuItem value={true}>כן</MenuItem>
                <MenuItem value={false}>לא</MenuItem>
              </Select>
            </FormControl>
            <br />

            <Button
              variant="outlined"
              color="default"
              className={classes.register_button}
              startIcon={<CloudUploadIcon />}
            >
              העלה תמונת פרופיל
            </Button>
            <br />
            {/* Send */}
            <Button
              variant="contained"
              color="secondary"
              size="large"
              className={classes.button}
              startIcon={<SaveIcon />}
            >
              שלח
            </Button>
          </form>
        </Paper>
      </Grid>
    </Grid>
  );
}
